import React, { Component } from "react";
import {Autocomplete} from "@mui/material"
export default class QuanLyNguoiDung extends Component {
  render() {
    return <div><Autocomplete
    disablePortal
    id="combo-box-demo"
    options={top100Films}
    sx={{ width: 300 }}
    renderInput={(params) => <TextField {...params} label="Movie" />}
  /></div>;
  }
}
